import React, { Component } from 'react';
import Navbar from '../common/Navbar'

class ProfileNav extends Component {
    state = {  }

    content = [
        {type:"link",text:"Home"},
        {type:"link",text:"AR Tour"},
        {type:"link",text:"Find Items"}
    ]

    render() { 
        return ( 
            <React.Fragment>
                <Navbar content={this.content}/>
            </React.Fragment>
         );
    }
}
 
export default ProfileNav;
